const point = '/img/point';

const result = {
    spring: [
        { id: 1, title: '', comment: '', src: '' }
    ],
    summer: [
        { id: 1, title: '', comment: '', src: '' }
    ],
    autumn: [
        { id: 1, title: '', comment: '', src: '' }
    ],
    winter: [
        { id: 1, title: '', comment: '', src: '' }
    ],
    point: [
        { id: 1, title: '', comment: '', src: '' }
    ]
};

export default result;
